import {  CoursePart} from "../types";
import Part from "./Part";

const Content = ({courseParts}: {courseParts: Array<CoursePart>}) => {
    return(
        <>
        {
            courseParts.map( part => {
                <Part key={part.name} course={part}  />
            })
        }
        </>
    )
}

export default Content;
